import * as React from 'react';
import sonedeImage from '../images/sonede.png';


export default class WelcomeContent extends React.Component {
  render() {
    return (
      <div>
      <img src={sonedeImage} alt="SONEDE" className="img-fluid mb-3 rounded mx-auto d-block" />
      <div className="container mt-4 ">
        <div className="jumbotron jumbotron-fluid">
          <div className="container">
            <h1 className="display-4 text-primary">Société Nationale d'Exploitation et de Distribution des Eaux (SONEDE)</h1>
            <p className="lead">Avenue Slimen Ben Slimen, El Manar II - Tunis 2092</p>
          </div>
        </div>

        <div className="row">
          <div className="col-md-8">
            <h2 className="text-info">Raison sociale</h2>
            <h5 className='mx-3'>Société Nationale d’Exploitation et de Distribution des Eaux (SONEDE).</h5>

            <h2 className="text-info">Siège social</h2>
            <h5>Avenue Slimen Ben Slimen, El Manar II - Tunis 2092.</h5>

            <h2 className="text-info">Forme juridique</h2>
            <h5>Établissement public créé par la loi 68-22 du 2 juillet 2968 telle que modifiée par la loi 76-22 du 22 janvier 2976 et considéré comme entreprise publique selon le décret 2004-2265 du 27 septembre 2004. La SONEDE est placée sous la tutelle du Ministère de l’Agriculture, des Ressources Hydrauliques et de la Pêche.</h5>


            <h2 className="text-info">Mission</h2>
            <h5>Amen CHERNI : Contrôleur d’État – Comité du Contrôle d’État – Présidence du Gouvernement.</h5>
          </div>

          <div className="col-md-4">
            {/* You can add additional content or use Bootstrap cards for better layout */}
          </div>
        </div>
      </div>
      </div>
    );
  };
}
